The example above shows the power of the Witness pattern. However, this type of permissioning works when T has drop. What if we have a case in which SomeObject<T: key + store>? In this case, we can use a slightly different version of the witness pattern: module examples::contract_b { use sui::object::{Self, UID}; use sui::tx_context::TxContext; use ob_utils::utils; struct ObjectB<T: key + store> has key, store { id: UID, obj: T } public fun new<W: drop, T: key + store>( _witness: W, obj: T, ctx: &mut TxContext ): ObjectB<T> { // Asserts that `W` and `T` come from the same // module, via type reflection utils::assert_same_module<W, T>(); ObjectB { id: object::new(ctx), obj } }
} Now this allow us to use the our witness object to insert any object from our module with key and store in Object<T>: module examples::contract_y { use sui::transfer; use sui::tx_context::{Self, TxContext}; use sui::object::{Self, UID}; use examples::contract_b; // Witness type struct Witness has drop {} struct TypeY has key, store { id: UID } fun init(ctx: &mut TxContext) { transfer::public_transfer( contract_b::new(Witness {}, TypeY { id: object::new(ctx) }, ctx), tx_context::sender(ctx) ) }
} Note that this pattern functions well for objects that wrap other objects with key and store. Under the hood we are using an assertion exported by the OriginByte utils module implemented as follows: /// Assert that two types are exported by the same module.
public fun assert_same_module<T1, T2>() { let (package_a, module_a, _) = get_package_module_type<T1>(); let (package_b, module_b, _) = get_package_module_type<T2>(); assert!(package_a == package_b, EInvalidWitnessPackage); assert!(module_a == module_b, EInvalidWitnessModule);
} public fun get_package_module_type<T>(): (String, String, String) { let t = string::utf8(ascii::into_bytes( type_name::into_string(type_name::get<T>()) )); get_package_module_type_raw(t)
} public fun get_package_module_type_raw(t: String): (String, String, String) { let delimiter = string::utf8(b"::"); // TBD: this can probably be hard-coded as all hex addrs are 64 bytes let package_delimiter_index = string::index_of(&t, &delimiter); let package_addr = sub_string(&t, 0, string::index_of(&t, &delimiter)); let tail = sub_string(&t, package_delimiter_index + 2, string::length(&t)); let module_delimiter_index = string::index_of(&tail, &delimiter); let module_name = sub_string(&tail, 0, module_delimiter_index); let type_name = sub_string(&tail, module_delimiter_index + 2, string::length(&tail)); (package_addr, module_name, type_name)
}

