The delegated witness functions as an hybrid between the Witness and the Publisher pattern with the addition that it provides a WitnessGenerator which allows for the witness creation to be delegated to other smart contracts/objects defined in modules other than the creator of T. In a nutshell, the differences between a Delegated-Witness and a typical Witness are: Deletaged-Witness has copy and it can therefore be easily propagated accross a stack of function calls; Deletaged-Witness is typed, and this in conjunction with the copy ability allows for the reduction of type-reflected assertions that are required to be perfomed accross the call stack A Delegated-Witness can be created by Witness {}, so like the witness its access can be designed by the smart contract that defines T; It can also be created directly through the Publisher object; It can be generated by a generator object WitnessGenerator<T> which has store ability, therefore allowing for witness-creation process to be more flexibly delegated. Note: This pattern enhaces the programability around object permissions but it should be handled with care, and developers ought to fully understand its safety implications. In addition, one can use this pattern without the WitnessGenerator<T>, rather this generator is in of itself a pattern that is built on top of the Delegated Witness. From the OriginByte permissions package we have: /// Delegated witness of a generic type. The type `T` can either be
/// the One-Time Witness of a collection or the type of an object itself.
struct Witness<phantom T> has copy, drop {} /// Delegate a delegated witness from arbitrary witness type
public fun from_witness<T, W: drop>(_witness: W): Witness<T> { utils::assert_same_module_as_witness<T, W>(); Witness {}
} /// Creates a delegated witness from a package publisher.
/// Useful for contracts which don't support our protocol the easy way,
/// but use the standard of publisher.
public fun from_publisher<T>(publisher: &Publisher): Witness<T> { utils::assert_publisher<T>(publisher); Witness {}
} We can now have two contract that do: module examples::contract_c { use sui::object::{Self, UID}; use sui::tx_context::TxContext; use ob_permissions::witness::{Witness as DelegatedWit}; struct ObjectC<T: key + store> has key, store { id: UID, obj: T } public fun new<T: key + store>( _delegated_wit: DelegatedWit<T>, obj: T, ctx: &mut TxContext ): ObjectC<T> { ObjectC { id: object::new(ctx), obj } }
} module examples::contract_d { use sui::object::{Self, UID}; use sui::tx_context::TxContext; use ob_permissions::witness::{Witness as DelegatedWit}; use examples::contract_c::{Self, ObjectC}; struct ObjectD<T: key + store> has key, store { id: UID, obj_c: ObjectC<T> } public fun new<T: key + store>( delegated_wit: DelegatedWit<T>, obj_c: T, ctx: &mut TxContext ): ObjectD<T> { ObjectD { id: object::new(ctx), obj_c: contract_c::new(delegated_wit, obj_c, ctx) } }
} In other words the authorization can be propagated throughout the call stack.

