Associated readings: Sui Move by Example: Witness The witness pattern is a fundamental pattern in Sui Move for building a permissioning system around the types of your smart contract. A certain contract might declare an Object<T> which uses the witness pattern to allow for the contract that creates T to maintain exclusivity when generating Object<T>. Let's say that in contract A declares the following type and constructor: module examples::contract_a { use sui::object::{Self, UID}; use sui::tx_context::TxContext; struct ObjectA<phantom T: drop> has key, store { id: UID } public fun new<T: drop>( _witness: T, ctx: &mut TxContext ): ObjectA<T> { ObjectA { id: object::new(ctx) } }
} Contract X can then declare a Witness type such that: module examples::contract_x { use sui::transfer; use sui::tx_context::{Self, TxContext}; use examples::contract_a; // Witness type struct TypeX has drop {} fun init(ctx: &mut TxContext) { transfer::public_transfer( contract_a::new(TypeX {}, ctx), tx_context::sender(ctx) ) }
} Given that only contract_b can instantiate TypeB, we guarante that Object<TypeB> can only be created by contract_b even though the generic object Object is declared in contract_a.
